import React from "react";
import "./style.css";

function OurMenu() {
    return(
        <div className="container">
            <h3>Our Menu</h3>
            <p className="lead-2">The pleasure of variety on your plate</p>
            <div className="menu">
                <div className="menu-column"></div>
                <div className="menu-column"></div>
            </div>
        </div>
    )   
}

export default OurMenu;
